import React, { useEffect, useState } from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import Navbar from "./Navbar";
import Login from "./Login";
import Register from "./Register";
import StudentDashboard from "./student/StudentDashboard";
import FacultyDashboard from "./faculty/FacultyDashboard";
import FacultyProfile from "./faculty/FacultyProfile";
import ViewStudents from "./faculty/ViewStudents";
import StudentRemarks from "./faculty/StudentRemarks";
import HODdashboard from "./hod/HODDashboard";
import "./App.css";

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [role, setRole] = useState(""); // ✅ Track user role
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setLoading(true);
    const token = localStorage.getItem("token");
    const userRole = localStorage.getItem("role"); // ✅ Get role from localStorage
    setIsAuthenticated(!!token);
    setRole(userRole);
    setTimeout(() => setLoading(false), 400);
  }, []);

  if (loading)
    return (
      <div className="loading-screen">
        <p>Loading...</p>
      </div>
    );

  return (
    <>
      <Navbar />
      <Routes>
        {/* ✅ Redirect Based on Role */}
        <Route
          path="/"
          element={
            isAuthenticated ? (
              role === "FACULTY" ? (
                <Navigate to="/faculty/dashboard" replace />
              ) : (
                <Navigate to="/dashboard/profile" replace />
              )
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />

        {/* ✅ Login & Register */}
        <Route
          path="/login"
          element={
            isAuthenticated ? (
              role === "FACULTY" ? (
                <Navigate to="/faculty/dashboard" replace />
              ) : (
                <Navigate to="/dashboard/profile" replace />
              )
            ) : (
              <Login />
            )
          }
        />
        <Route
          path="/hod"
          element={
            isAuthenticated ? (
              role === "HOD" ? (
                <Navigate to="/hod/HODDashboard" replace />
              ) : (
                <Navigate to="HODdashboard" replace />
              )
            ) : (
              <HODdashboard />
            )
          }
        />
        <Route
          path="/register"
          element={
            isAuthenticated ? (
              role === "FACULTY" ? (
                <Navigate to="/faculty/dashboard" replace />
              ) : (
                <Navigate to="/dashboard/profile" replace />
              )
            ) : (
              <Register />
            )
          }
        />

        {/* ✅ Student Routes */}
        <Route
          path="/dashboard/*"
          element={
            isAuthenticated && role !== "FACULTY" ? (
              <StudentDashboard />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />

        {/* ✅ Faculty Routes */}
        <Route
          path="/faculty/dashboard"
          element={
            isAuthenticated && role === "FACULTY" ? (
              <FacultyDashboard />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
        <Route
          path="/faculty/profile"
          element={
            isAuthenticated && role === "FACULTY" ? (
              <FacultyProfile />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
        <Route
          path="/faculty/students"
          element={
            isAuthenticated && role === "FACULTY" ? (
              <ViewStudents />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
        <Route
          path="/faculty/remarks"
          element={
            isAuthenticated && role === "FACULTY" ? (
              <StudentRemarks />
            ) : (
              <Navigate to="/login" replace />
            )
          }
        />
      </Routes>
    </>
  );
};

export default App;
